import React, { Component } from 'react'
import { BrowserRouter, Route,} from 'react-router-dom';
import './App.css';
import BarDeRecherche from './component/barDeRecherche';
import FilmsList from "./component/filmes"
import Navbar from "./component/navbar"
import Signin from "./component/signin"
import Signup from "./component/signup"
import Home from "./component/home"
import Favorit from "./component/Favorit"
import PosterFilm from './component/posterfilm';




export class App extends Component {
   mesfilmslist = [{
    img:"data:image/jpeg;base64,",
    title:" batman ",
    etoile:"5"
    
  },
  {
    img:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcR7llfwMvBSc9We6fRPz3XF3xrivxlN2HlnxwCu1ETLprMzndar&usqp=CAU",
    title:"Sans un bruit",
    etoile:"5"
  
  },
  {
    img:"https://fr.web.img5.acsta.net/pictures/20/01/23/09/02/1428612.jpg",
    title:"bloodshot",
    etoile:"5"
  
  },
  {
    img:"data:image/jpeg;base64,",
    title:"sous pression",
    etoile:"5"
  
  },
  {
    img:"data:image/jpeg;base64,",
    title:"the conjuring",
    etoile:"5"
  
  },
   {
    img:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTG30prnEjMw-QsFRF1iaNJqmnpj-Il0I3twp2MGXX8wmX8n6aT&usqp=CAU",
    title:"The Pale Door",
    etoile:"5"
  
  },
  {
    img:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQopZVKNa2BdnnnaALMLkAQa7SRKRNi9G6TsPJ3UeeKPCiqzXKX&usqp=CAU",
    title:"inception",
    etoile:"5"
  
  }]
  
  constructor() {
    super()
    
    this.state = {
      m:this.mesfilmslist,
      titredefilem :"",
      
       
    }
    this.Favourites = [];
    
    
  }
  
 filterFilm (){
  const fi = this.state.m
    return ((fi).filter(
      el => el.title.includes(this.state.titredefilem.toLocaleLowerCase())
      ))
  }
  
  ajouterFilm=(nouveuFilm)=> {
    this.setState({
      m: this.state.m.concat(nouveuFilm)
    })  
  }
  adFav = (el) => {
       this.Favourites.push(this.state.m[el])
       
  };
  

  render() {
    return (
      <BrowserRouter>
      <div className="App">
      <Navbar />
      <Route path="/" exact component={Home} />
      <Route path ="/Signup"  component={Signup} />
      <Route path="/Signin"  component={Signin} />
      <Route path="/Favorit"  render ={()=> <Favorit favoriteList={this.Favourites} />}  />
      <Route path="/Movies"  render = {() =><BarDeRecherche value={this.state.titredefilem} onChange={(newTitleFilter) => {this.setState({titredefilem: newTitleFilter})}} />} />
      <Route path="/Movies"  render = {() => < FilmsList a={this.filterFilm() } ajouter={(nouveuFilm)=>this.ajouterFilm(nouveuFilm)} add ={this.adFav}   />}  />
      </div>
    </BrowserRouter>  
    )
  }
}

export default App





